import React from "react";
import {formatDate} from "../../formatDate";
import './OrderShedule/OrderShedule.css'

const OrderShedule = (props) => {
    return (
        <>
            <div className="orderSheduleContainer">
                {props.aaaa.map(i => <div style={{display: "flex"}}>
                    <div>{i.froms}</div>
                    <div className="borderElement" style={{padding: 20}}>{i.to}</div>
                    <div className="borderElement">{formatDate(new Date(i.date))}</div>
                    <div>{i.price} Ñ€.</div>
                </div>)}
            </div>
        </>
    )
}

export default OrderShedule;
